import React from "react"
import {useHttp} from "../hooks/http.hook"
import {useMessage} from "../hooks/message.hook"

export const RegisterPage = () => {
    const message = useMessage()
    const {loading,error,request} = useHttp()
    const [form,setForm] = React.useState({
        email: '', password: ''
    })

    useEffect(() => {

    },[error])

    const changeHandler = event => {
        setForm({...form, [event.target.name]:event.target.value})
    }

    const registerHandler = async () => {
        try {
            const data = await request('/api/auth/register','POST', {...form})
            console.log('Data ',data)
        } catch (e) {

        }
    }

    return (
        <div className="row">
            <div className="col s6 offset-s3">
                <div className="card grey lighten-4 rounded">
                    <div className="card-content white-text">
                        <span className="card-title black-text">Authorization</span>
                        <div>
                            <div className="input-field black-text">
                                <input
                                    placeholder=""
                                    id="email"
                                    name="email"
                                    type="text"
                                    className="black-text"
                                />
                                <label htmlFor="email">Email</label>
                            </div>
                            <div className="input-field black-text">
                                <input
                                    placeholder=""
                                    id="password"
                                    name="password"
                                    type="password"
                                    className="black-text"
                                />
                                <label htmlFor="password">Password</label>
                            </div>
                        </div>
                    </div>
                    <div className="card-action">
                        <div className="row">
                            <button
                                className="btn blue"
                                onClick={registerHandler}
                                disabled={loading}
                            >
                                Sign Up
                            </button>
                        </div>
                        <span>Already have account? <a href="/" className="black-text text-lighten-4">Log in</a></span>
                    </div>
                </div>
            </div>
        </div>
    )
}
